                writer.WriteBoolean("refunded", mission.RefundedOption.Value!.Value);

            if (mission.NotificationsCreatedOption.IsSet)
                writer.WriteBoolean("notificationsCreated", mission.NotificationsCreatedOption.Value!.Value);

            if (mission.RewardedOption.IsSet)
                writer.WriteBoolean("rewarded", mission.RewardedOption.Value!.Value);

            if (mission.ExternalIdOption.IsSet)
                writer.WriteNumber("externalId", mission.ExternalIdOption.Value!.Value);

            if (mission.AdvancedReportingOption.IsSet)
                writer.WriteBoolean("advancedReporting", mission.AdvancedReportingOption.Value!.Value);

            var splitRewardRawValue = Mission.SplitRewardEnumToJsonValue(mission.SplitRewardOption.Value!.Value);
            writer.WriteString("splitReward", splitRewardRawValue);
            if (mission.JoinCodeOption.IsSet)
                writer.WriteString("joinCode", mission.JoinCode);

            if (mission.FirstPackOption.IsSet)
            {
                writer.WritePropertyName("firstPack");
                JsonSerializer.Serialize(writer, mission.FirstPack, jsonSerializerOptions);
            }
            if (mission.AllGameLevelsOption.IsSet)
            {
                writer.WritePropertyName("allGameLevels");
                JsonSerializer.Serialize(writer, mission.AllGameLevels, jsonSerializerOptions);
            }
            if (mission.AllPacksOption.IsSet)
            {
                writer.WritePropertyName("allPacks");
                JsonSerializer.Serialize(writer, mission.AllPacks, jsonSerializerOptions);
            }
        }
    }
}
